import React from "react";
import Particles from "react-particles";
import { particleInit } from "tsparticles";

const Part = () => {
  const particleInit = async (engine) => {
    await loadFull(engine);
  };  
  return (
        
        <Particles params={{
            particles: {
                color: { value: "#F02122" },
                number: {
                value: 300,
                density: {
                  enable: true,
                  value_area: 800
                }
              }
            }
          }}></Particles>
          
    )
}

export default Part;
